  <>
    <Carousel
      slidesPerPage={1}
      itemWidth={335}
      keepDirectionWhenDragging
      dots
      centered
    >
      { props.children }
    </Carousel>
    <Dots className='dotStyle' />

    <style jsx>{`
      .dotStyle{

      }
    `}</style>
  </>
)

export default MobileCarousel

const DotStyle = styled.div`
  background-color: red;
`
